import{_ as a,o as e,c as t,b as o}from"./chunks/framework.dd5ab16e.js";const m=JSON.parse('{"title":"ОТ УМА","description":"","frontmatter":{"title":"ОТ УМА","date":"2018-12-06","icon":"zP2Z7Lhba3k.jpg","cover":"cover.webp","instagram":"otuma_house","facebook":"otumahouse","tel":"+7 (965) 41-555-41","email":"rent@otumahouse.ru","url":"https://www.otumahouse.ru","address":"Костомаровский пер., дом 3, стр. 3, 2 этаж","place":"м. Курская","city":"г. Москва","coord":[55.7523167004053,37.66502345634659],"status":"open"},"headers":[],"relativePath":"workshop/catalog/ot-uma/index.md","filePath":"workshop/catalog/ot-uma/index.md"}'),r={name:"workshop/catalog/ot-uma/index.md"},i=o('<h5 id="креативныи-дом-от-ума-–-это-светлое-уютное-место-расположенное-в-центре-москвы-всего-в-7-минутах-от-м-курская" tabindex="-1">Креативный Дом ОТ УМА – это светлое уютное место, расположенное в центре Москвы, всего в 7 минутах от м. Курская. <a class="header-anchor" href="#креативныи-дом-от-ума-–-это-светлое-уютное-место-расположенное-в-центре-москвы-всего-в-7-минутах-от-м-курская" aria-label="Permalink to &quot;Креативный Дом ОТ УМА – это светлое уютное место, расположенное в центре Москвы, всего в 7 минутах от м. Курская.&quot;">​</a></h5><p>ОТ УМА - это маленькая творческая семья &quot;своих&quot; и мечтающих. И мы надеемся, что эта семья будет становиться больше. Мы хотели бы изменить мир, но начинаем с себя и того, что происходит рядом. Мы поклонники всего здорового, красивого и мыслящего. И считаем, что все хорошее и доброе - оно обязательно ОТ УМА</p><h4 id="каждыи-уголок-нашего-пространства-можно-арендовать-на-необходимое-для-вас-время" tabindex="-1">Каждый уголок нашего пространства можно арендовать на необходимое для вас время <a class="header-anchor" href="#каждыи-уголок-нашего-пространства-можно-арендовать-на-необходимое-для-вас-время" aria-label="Permalink to &quot;Каждый уголок нашего пространства можно арендовать на необходимое для вас время&quot;">​</a></h4><p>В нашем Доме ОТ УМА мы реализуем свои идеи и хотим, чтобы вы воплощали свои. Приглашайте своих клиентов, назначайте встречи с партнерами. Проводите мастер-классы, тренинги, консультации. Организуйте свой временный магазин или мастерскую. Делайте фото и видео контент своего продукта. Приходите просто поработать над своей идеей, одни или с командой.</p><h5 id="для-чего-к-нам-приходят" tabindex="-1">ДЛЯ ЧЕГО К НАМ ПРИХОДЯТ <a class="header-anchor" href="#для-чего-к-нам-приходят" aria-label="Permalink to &quot;ДЛЯ ЧЕГО К НАМ ПРИХОДЯТ&quot;">​</a></h5><ul><li>проводить занятия, мастер-классы, лекции</li><li>встретиться с клиентами, партнерами</li><li>снять фото, видео своих встреч, продуктов</li><li>организовать презентацию своего бренда</li></ul><h3 id="наши-залы" tabindex="-1">Наши залы <a class="header-anchor" href="#наши-залы" aria-label="Permalink to &quot;Наши залы&quot;">​</a></h3><h4 id="большои-открытыи-зал" tabindex="-1">Большой Открытый зал <a class="header-anchor" href="#большои-открытыи-зал" aria-label="Permalink to &quot;Большой Открытый зал&quot;">​</a></h4><p>Вместимость до 20 человек. 45 кв м от 600 до 1200 руб/час</p><h4 id="мастерская-среднии-зал" tabindex="-1">Мастерская (Средний зал) <a class="header-anchor" href="#мастерская-среднии-зал" aria-label="Permalink to &quot;Мастерская (Средний зал)&quot;">​</a></h4><p>Вместимость до 20 человек. 30 кв м от 600 до 1200 руб/час</p><h4 id="уютныи-малыи-зал-no9" tabindex="-1">Уютный малый зал (№9) <a class="header-anchor" href="#уютныи-малыи-зал-no9" aria-label="Permalink to &quot;Уютный малый зал (№9)&quot;">​</a></h4><p>Вместимость до 10 человек. 19 кв м 800 руб/час</p><h4 id="рабочие-места" tabindex="-1">Рабочие места <a class="header-anchor" href="#рабочие-места" aria-label="Permalink to &quot;Рабочие места&quot;">​</a></h4><p>В будни в наш Дом ОТ УМА можно прийти и поработать в любом свободном зале или в общей открытой зоне. На территории есть кафе, где можно запастись кофе или перекусить, а на нашей кухне вы всегда сможете сами приготовить себе чашечку чая. Wi-Fi бесплатный с хорошей скоростью. Есть принтер. Приятная музыка тоже прилагается. Берите ноутбук, краски, кисточки и приходите в гости. Предварительно позвоните или напишите нам в вотсап, чтобы уточнить наличие свободных мест.</p>',15),l=[i];function h(n,s,c,d,u,p){return e(),t("div",null,l)}const b=a(r,[["render",h]]);export{m as __pageData,b as default};
